    data: |
      SELECT * FROM tab2 (FORMAT parquet) cor0 WHERE + col1 NOT BETWEEN + CAST ( 66 AS INTEGER ) + + col0 AND 29 * - col2;
  - name: tab2

outputs:
  - name: q6115.out
    data: |
      46	51	23
      64	77	40
      75	67	58
